var window;

function setWindow() {

  window = floaty.window(
    <vertical gravity="center" bg="#000000" alpha="0.8">
      <horizontal>
        <text id="swipesText" textSize="16sp" text="Swipes:" textColor="#ffffff" />
        <text id="swipes" textSize="16sp" textColor="#BCAE62" />
        <text id="searchText" textSize="16sp" text="Search:" textColor="#ffffff" />
        <text id="search" textSize="16sp" textColor="#BCAE62" />
      </horizontal>
      <horizontal>
        <text id="likeText" textSize="16sp" text="Like:" textColor="#ffffff" />
        <text id="like" textSize="16sp" textColor="#BCAE62" />
        <text id="followText" textSize="16sp" text="Follow:" textColor="#ffffff" />
        <text id="follow" textSize="16sp" textColor="#BCAE62" />
      </horizontal>
      <horizontal>
        <text id="commentText" textSize="16sp" text="Comment:" textColor="#ffffff" />
        <text id="comment" textSize="16sp" textColor="#BCAE62" />
        <text id="favoriteText" textSize="16sp" text="Favorite:" textColor="#ffffff" />
        <text id="favorite" textSize="16sp" textColor="#BCAE62" />
      </horizontal>
      <button id="actionBtn" text="Pause[Volume-]" />
      <button id="exitBtn" text="Exit" />

    </vertical>
  );


  //暂停按钮
  window.actionBtn.click(function () {
    isRunning = !isRunning;
    if (isRunning == false) {
      window.actionBtn.setText('Continue[Volume+]');
    } else {
      window.actionBtn.setText('Pause[Volume-]');
    }

  })

  //退出按钮
  window.exitBtn.click(function () {
    logx("exit");
    window.close();
    // exit();
  })
  //监听音量下键弹起



  events.onKeyDown("volume_up", function (event) {
    logx("volume_up");
    ui.run(function () {
      window.actionBtn.setText('Pause[Volume-]');
      isRunning = true;
    })

  });
  //监听Home键弹起
  events.onKeyDown("volume_down", function (event) {
    logx("volume_down");
    ui.run(function () {
      window.actionBtn.setText('Continue[Volume+]');
      isRunning = false;
    })

  })
  updateUI();
}




